INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36122', '1', '54389', 'Tamanho do bucket padro para o clculo da demanda mdia de todas as SPUs. Esse parmetro  utilizado no caso de uso de tamanho de buckets variveis para as SPUs.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36123', '1', '54371', 'Intervalo mximo, em meses, entre demandas durante o histrico relevante para que a SPU seja considerada muito repetitiva para SPUs de buckets mensais.');
