INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36126', '1', '54376', 'Incio default para a anlise do perodo histrico relevante para o clculo das estatsticas do comportamento da demanda.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36127', '1', '54351', 'Indicador lgico para a avaliao de previsibilidade para as SPUs de relevncia de desvio padro valorizado B. A avaliao de previsibilidade sempre  feita para as SPUs de relevncia de desvio padro valorizado A, desde que haja nmero suficiente de amostras de erro de previso. A avaliao de previsibilidade nunca  feita para as SPUs de relevncia de desvio padro valorizado C. A considerao ou no das SPUs com relevncia de desvio padro valorizado B depende deste parmetro.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36128', '1', '54363', 'Intervalo mximo, em dias, entre demandas durante o histrico relevante para que a SPU seja considerada muito repetitiva para SPUs de buckets dirios.');
