INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36130', '1', '54365', 'Intervalo mximo, em dias, entre demandas durante o histrico relevante para que a SPU seja considerada espordica para SPUs de buckets dirios. Se houver intervalos superiores a este valor a SPU  considerada muito espordica.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36131', '1', '54367', 'Intervalo mximo, em semanas, entre demandas durante o histrico relevante para que a SPU seja considerada muito repetitiva para SPUs de buckets semanais.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36132', '1', '54368', 'Intervalo mximo, em semanas, entre demandas durante o histrico relevante para que a SPU seja considerada repetitiva para SPUs de buckets semanais.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36133', '1', '54369', 'Intervalo mximo, em semanas, entre demandas durante o histrico relevante para que a SPU seja considerada espordica para SPUs de buckets semanais. Se houver intervalos superiores a este valor a SPU  considerada muito espordica.');
