INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36137', '1', '54347', 'Parmetro para indicar se o sistema deve automaticamente corrigir os outliers inferiores.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36138', '1', '54349', 'Limite inferior a ser estabelecido, se a limitao automtica estiver habilitada, para os pontos identificados como outliers superiores.  dado em mltiplos de IQR ? Interquartile Range, ou IQD - Distncia Interquartil. Valor tpico 1,50. Demandas menores que o limite inferior so consideradas nulas para efeito das estatsticas de demanda.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36139', '1', '54333', 'Origem da demanda dependente usada na anlise. Se o uso de estimativas estiver habilitado, a origem pode ser a demanda histrica, a demanda estimada ou a maior das duas. Se o uso de estimativas no estiver habilitado a origem ser a demanda histrica. Se o uso da demanda histrica no estiver habilitada, a origem ser a estimativa.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36140', '1', '54345', 'Limite superior a ser estabelecido, se a limitao automtica estiver habilitada, para os pontos identificados como outliers superiores.  dado em mltiplos de IQR ? Interquartile Range, ou IQD - Distncia Interquartil. Valor tpico 1,50.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36141', '1', '54343', 'Parmetro para indicar se o sistema deve automaticamente corrigir os outliers superiores.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36142', '1', '54341', 'Critrio de identificao de outliers. A identificao de outliers usa o critrio de IQR ? Interquartile Range, ou IQD - Distncia Interquartil. Valor tpico 1,50. Se o valor da demanda em um determinado bucket  superior ao limite estabelecido, ento o valor  identificado como um outlier. O limite estabelecido  dado pelo valor do terceiro quartil mais a distncia interquartil, multiplicada pelo fator estabelecido.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('36143', '1', '54339', 'Nvel de confiana para o teste de hipteses de normalidade da demanda. Valor tpico 95%.');
