INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37664', '1', '55760', 'Ordem de precedncia da aplicao dos pesos e das notas de criticidade. Os pesos dos critrios de criticidade podem ser definidos para a anlise como um todo e para as Unidades de Gesto. As notas podem ser definidas para os itens e para as SPUs. Os critrios de criticidade em si so definidos para a anlise como um todo e no podem ser alterados nos nveis mais baixos.
Os valores possveis so:
01 ? Precedncia: particular para geral
02 ? Precedncia: geral para particular
A precedncia 01 ? particular para o geral significa que se pode definir uma regra geral no nvel mais alto, mas se houver uma definio diferente para um nvel mais baixo, vale prioritariamente o nvel mais baixo. Ou seja, valem as excees.
A precedncia 02 ? geral para particular, significa que a regra geral se sobrepe s regras de exceo. Impe-se a regra geral sobre quaisquer excees feitas nos nveis mais baixos.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37665', '1', '55761', 'Ordem de precedncia da aplicao das notas dos fatores qualitativos. As notas podem ser definidas para os itens e para as SPUs. Os fatores qualitativos em si so definidos para a anlise como um todo e no podem ser alterados nos nveis mais baixos.
Os valores possveis so:
01 ? Precedncia: particular para geral
02 ? Precedncia: geral para particular.
A precedncia 01 ? particular para o geral significa que se pode definir uma regra geral no nvel mais alto, mas se houver uma definio diferente para um nvel mais baixo, vale prioritariamente o nvel mais baixo. Ou seja, valem as excees.
A precedncia 02 ? geral para particular, significa que a regra geral se sobrepe s regras de exceo. Impe-se a regra geral sobre quaisquer excees feitas nos nveis mais baixos.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37666', '1', '55762', 'Parmetro que indica a precedncia da sugesto do sistema sobre o input do usurio para os custos mdio, de reposio e alternativo.
Os valores possveis so:
01 ? Usurio ? Este  o valor default para este parmetro. Neste caso, se o usurio definir um valor, o valor efetivo  o definido pelo usurio. Se o usurio no definir um valor, o valor efetivo  o sugerido pelo sistema a partir dos custos das alternativas de suprimento.
02 ? Sistema ? Neste caso mesmo que o usurio defina um valor, o valor efetivo  o valor sugerido pelo sistema a partir dos custos das alternativas de suprimento. Este parmetro s  utilizado se a funo de utilizao de alternativas de suprimento estiver habilitada.');
