02 ? Sistema ? Neste caso mesmo que o usurio defina um valor, o valor efetivo  o valor sugerido pelo sistema a partir dos custos das alternativas de suprimento. Este parmetro s  utilizado se a funo de utilizao de alternativas de suprimento estiver habilitada.');
