INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37673', '1', '55768', 'Este parmetro indica a precedncia dos ajustes sobre o histrico de produo e de previso de produo feitos diretamente pelos usurios.
Os valores possveis so:
01 ? Usurio ? Este  o valor default para este parmetro. Neste caso, se os usurios definirem valores nos histricos de produo e de previso de produo para os buckets, os valores efetivos so os definidos pelos usurios. Se os usurios no definirem valores, os valores efetivos so os valores calculados pela sumarizao dos buckets de produo pelo sistema.
02 ? Sistema ? Neste caso mesmo que os usurios definam valores no histrico de produo e de previso de produo, os valores efetivos so os valores calculados pela sumarizao dos buckets de produo pelo sistema.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37674', '1', '55769', 'Este parmetro indica a precedncia dos ajustes sobre o histrico de demanda e de previso de demanda feitos diretamente pelos usurios e os ajustes sugeridos pela anlise de outliers feita pelo sistema Proper.
Os valores possveis so:
01 ? Usurio ? Este  o valor default para este parmetro. Neste caso, se os usurios definirem valores nos histricos de demanda e de previso de demanda para os buckets, os valores efetivos so os definidos pelos usurios. Se os usurios no definirem valores, os valores efetivos so os valores sugeridos pelo sistema.
02 ? Sistema ? Neste caso mesmo que os usurios definam valores no histrico de demanda e de previso de demanda, os valores efetivos so os valores sugeridos pelo sistema.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37675', '1', '55770', 'Este parmetro indica a precedncia da escolha do mtodo de gesto feita diretamente pelos usurios e os mtodos de gesto sugeridos pelo sistema Proper.
Os valores possveis so:
01 ? Usurio ? Este  o valor default para este parmetro. Neste caso, se os usurios definirem mtodos de gesto, os mtodos efetivos so os definidos pelos usurios. Se os usurios no definirem mtodos de gesto, os mtodos efetivos so os mtodos sugeridos pelo sistema.
02 ? Sistema ? Neste caso mesmo que os usurios definam mtodos de gesto, os mtodos efetivos so os mtodos sugeridos pelo sistema. Isso vale a menos que o sistema no tenha sido capaz de sugerir o mtodo. Nesse caso, vale o definido pelo usurio.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37676', '1', '55771', 'Este parmetro indica a precedncia da escolha do estoque de segurana feita diretamente pelos usurios e os estoques de segurana sugeridos pelo sistema Proper.
Os valores possveis so:
01 ? Usurio ? Este  o valor default para este parmetro. Neste caso, se os usurios definirem estoques de segurana, os estoques de segurana efetivos so os definidos pelos usurios. Se os usurios no definirem estoques de segurana, os estoques de segurana efetivos so os estoques sugeridos pelo sistema.
02 ? Sistema ? Neste caso mesmo que os usurios definam estoques de segurana, os estoques de segurana efetivos so os estoques sugeridos pelo sistema. Isso vale a menos que o sistema no tenha sido capaz de sugerir o estoque de segurana. Nesse caso, vale o definido pelo usurio.');
INSERT Term_language (id,language_id,term_id,term_description) VALUES ('37677', '1', '55772', 'Este parmetro indica a precedncia da escolha do tamanho de lote econmico feita diretamente pelos usurios e os tamanhos de lote sugeridos pelo sistema Proper.
Os valores possveis so:
01 ? Usurio ? Este  o valor default para este parmetro. Neste caso, se os usurios definirem tamanhos de lote, os lotes efetivos so os definidos pelos usurios. Se os usurios no definirem tamanhos de lote, os lotes efetivos so os lotes sugeridos pelo sistema.
02 ? Sistema ? Neste caso mesmo que os usurios definam tamanhos de lote, os lotes efetivos so os lotes sugeridos pelo sistema. Isso vale a menos que o sistema no tenha sido capaz de sugerir o tamanho de lote. Nesse caso, vale o definido pelo usurio.');
